import About from "./Pages/About";
import Resume from "./Pages/Resume";
import Contact from "./Pages/Contact";
import Background from './Images/background.png'
import history from './history';

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentDidMount = () =>{
    // history.push('/#/about')
  }

  render() {
    return (
      <HashRouter basename='/'>
        <div className="App-header">
        <div className="bg-img" >
        <div style={{backgroundColor:"black",opacity:"0"}}>
        <div className="pinNavbar">
        <Navbar/>
        </div>
        <Switch >


          <Route path="/resume">
            <Resume/>
          </Route>
          <Route path="/projects">
            projects
          </Route>
          <Route path="/contact">
            <Contact/>
          </Route>
          <Route path="/">
            <About/>
          </Route>
        </Switch>
        </div>
        </div>
        </div>
        </HashRouter>
    );
  }
}

export default Home;


